import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import fiestaLogo from '../assets/fiesta-logo.png'; // Adjust path if needed

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const [showDetails, setShowDetails] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData || !violationsData) return <div>Loading...</div>;

  // Define visible fields
  const visibleFields = [
    { key: 'agentname', label: 'Agent Name' },
    { key: 'region', label: 'Region' },
    { key: 'nbrwbf', label: 'NB BF' },
    { key: 'enfees', label: 'Endo Fees' },
    { key: 'totalnben', label: 'NB+EN Total' },
  ];

  const expensesFields = [
    { key: 'grosspay', label: 'Gross Pay' },
    { key: 'totalnbs', label: 'Total NBs' },
    { key: 'nbcorffee', label: 'NB Corp Fees' },
    { key: 'encorpfee', label: 'Endo Corp Fees' },
    { key: 'refferalspayout', label: 'Referrals/Pay Out' },
  ];

  const additionalFields = [
    { key: 'nben(afterfees)', label: 'Total Rev After Fees' },
    { key: 'reissuerenewaltotal', label: 'Reinstatement and Renewal Fees' },
    { key: 'bonustier', label: 'Bonus Tier' },
    { key: 'totalbonus', label: 'Bonus' },
    { key: 'totalviolations', label: 'Total Violations' },
    { key: 'commissionafterarfeescanningviolations', label: 'Total Commission' },
  ];

  const otherDetails = Object.entries(commissionData)
    .filter(([key]) => ![...visibleFields, ...expensesFields, ...additionalFields].map(f => f.key).includes(key))
    .map(([key, value]) => (
      <div key={key} style={{ marginBottom: "4px" }}>
        <strong>{key}:</strong> {value || "N/A"}
      </div>
    ));

  return (
    <div style={{ fontFamily: "Arial, sans-serif" }}>
      {/* Header */}
      <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between", backgroundColor: "#d32f2f", color: "#fff", padding: "10px 20px" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src={fiestaLogo} alt="Fiesta Logo" style={{ height: "40px", marginRight: "10px" }} />
          <h1 style={{ margin: 0, fontSize: "20px" }}>Agent Dashboard</h1>
        </div>
        <button onClick={handleLogout} style={{ padding: "5px 10px", cursor: "pointer" }}>Logout</button>
      </div>

      <div style={{ padding: "20px" }}>
        {/* Weekly Commission */}
        <div style={{ marginTop: "20px", border: "1px solid #ddd", borderRadius: "5px", backgroundColor: "#fff" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold" }}>
            Weekly Commission
          </div>
          <div style={{ padding: "10px" }}>
            {visibleFields.map(field => (
              <div key={field.key} style={{ marginBottom: "4px" }}>
                <strong>{field.label}:</strong> {commissionData[field.key] || "N/A"}
              </div>
            ))}

            <div style={{ marginTop: "10px", marginBottom: "10px" }}>
              <strong style={{ color: "#d32f2f" }}>Expenses</strong>
              {expensesFields.map(field => (
                <div key={field.key} style={{ marginBottom: "4px" }}>
                  <strong>{field.label}:</strong> {commissionData[field.key] || "N/A"}
                </div>
              ))}
            </div>

            {additionalFields.map(field => (
              <div key={field.key} style={{ marginBottom: "4px" }}>
                <strong>{field.label}:</strong> {commissionData[field.key] || "N/A"}
              </div>
            ))}

            <small style={{ color: "gray" }}>* must be $500 or more in Total Rev After Fees to qualify for COMMISSION.</small>

            <div>
              <button onClick={() => setShowDetails(!showDetails)} style={{ marginTop: "10px" }}>
                {showDetails ? "Hide" : "Show"} Other Details
              </button>
              {showDetails && <div>{otherDetails}</div>}
            </div>
          </div>
        </div>

        {/* Scanning Violations & ARs */}
        <div style={{ marginTop: "20px", border: "1px solid #ddd", borderRadius: "5px", backgroundColor: "#fff" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold" }}>
            Scanning Violations & ARs
          </div>
          <div style={{ padding: "10px" }}>
            {Array.isArray(violationsData) ? (
              violationsData.length > 0 ? (
                violationsData.map((violation, index) => (
                  <div key={index} style={{ marginBottom: "10px", borderBottom: "1px solid #ccc", paddingBottom: "5px" }}>
                    {Object.entries(violation).map(([key, value]) => (
                      <div key={key}>
                        <strong>{key}:</strong> {value || "N/A"}
                      </div>
                    ))}
                  </div>
                ))
              ) : (
                <p>No violations found.</p>
              )
            ) : (
              Object.entries(violationsData).map(([key, value]) => (
                <div key={key} style={{ marginBottom: "4px" }}>
                  <strong>{key}:</strong> {value || "N/A"}
                </div>
              ))
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
